window.bookSummaryJSON = "<p>A pox of time and space is ravaging both ends of the world. It is unpredictable and unstoppable, devouring everything it touches.</p> <p>As the Windom Academy welcomes squires from the Day into its ranks, cultures and beliefs clash over the true nature of the pox and how to stop it.</p> <p>Jono and his team begin to fracture as they struggle to save a world from an enemy they don't understand.</p>"; 
